            int playerMagicAttack = 15;
            int playerExplosionAttack = 50;
            int playerCurePower = 25;

            int playerMagicAttackManaCost = 10;
            int playerCureManaCost = 30;
            bool isExplosionAviable = false;

            int bossHealth = 100;
            int bossPhysicAttack = 10;

            bool isBattleFinished = false;

            while (!isBattleFinished)
            {
                Console.WriteLine($"–ù–∞—á–∞–ª—Å—è –Ω–æ–≤—ã–π —Ä–∞—É–Ω–¥. –£ –≤–∞—Å {playerHealth} –∂–∏–∑–Ω–µ–π. –£ –±–æ—Å—Å–∞ {bossHealth} –∂–∏–∑–Ω–µ–π");

                Console.WriteLine("–í—ã–±–µ—Ä–∏—Ç–µ –¥–µ–π—Å—Ç–≤–∏–µ: " +
                    "\n 1 - –û–±—ã—á–Ω–∞—è –∞—Ç–∞–∫–∞" +
                    "\n 2 - –ú–∞–≥–∏—á–µ—Å–∫–∞—è –∞—Ç–∞–∫–∞" +
                    "\n 3 - –í–∑—Ä—ã–≤" +
                    "\n 4 - –õ–µ—á–µ–Ω–∏–µ" );
                string userInput = Console.ReadLine();

                switch (userInput)
                {
                    case "1":
                        bossHealth -= playerPhysicAttack;
                        Console.WriteLine($"–í—ã –Ω–∞–Ω–µ—Å–ª–∏ {playerPhysicAttack} —É—Ä–æ–Ω–∞");
                        break;
                    case "2":
                        if(playerMana >= playerMagicAttackManaCost)
                        {
                            bossHealth -= playerMagicAttack;
                            playerMana -= playerMagicAttackManaCost;
                            isExplosionAviable = true;
                            Console.WriteLine($"–í—ã –Ω–∞–Ω–µ—Å–ª–∏ {playerMagicAttack} —É—Ä–æ–Ω–∞");
                        }
                        else
                        {
                            Console.WriteLine("–ù–µ —Ö–≤–∞—Ç–∞–µ—Ç –º–∞–Ω—ã");
                        }
                        break;
                    case "3":
                        if (isExplosionAviable)
                        {
                            bossHealth -= playerExplosionAttack;
                            isExplosionAviable = false;
                            Console.WriteLine($"–í—ã –Ω–∞–Ω–µ—Å–ª–∏ {playerExplosionAttack} —É—Ä–æ–Ω–∞");
                        }
                        else
                        {
                            Console.WriteLine("–í–∑—Ä—ã–≤ –Ω–µ–¥–æ—Å—Ç—É–ø–µ–Ω");
                        }
                        break;
                    case "4":
                        if (playerMana >= playerCureManaCost)
                        {
                            playerMana -= playerCureManaCost;
                            playerHealth += playerCurePower;
                            Console.WriteLine($"–í—ã –≤–æ—Å—Å—Ç–∞–Ω–æ–≤–∏–ª–∏ {playerCurePower} –∂–∏–∑–Ω–µ–π");
                        }
                        else
                        {
                            Console.WriteLine("–ù–µ —Ö–≤–∞—Ç–∞–µ—Ç –º–∞–Ω—ã");
                        }
                        break;
                    default:
                        Console.WriteLine("–í—ã –ø—Ä–æ–ø—É—Å–∫–∞–µ—Ç–µ —Ö–æ–¥");
                        break;
                }
                if (bossHealth > 0)
                {
