                    Console.WriteLine($"–ë–æ—Å—Å –∞—Ç–∞–∫—É–µ—Ç –∏ –Ω–∞–Ω–æ—Å–∏—Ç {bossPhysicAttack} —É—Ä–æ–Ω–∞");

