                        break;
                    }
                }
                else
                {
                    Console.WriteLine($"–ë–æ—Å—Å –ø–æ–≤–µ—Ä–∂–µ–Ω");
                    isBattleFinished = true;
                    break;
                }
            }
            Console.ReadLine();
        }
    }
