using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace CSLight
{
    internal class Program
    {
        static void Main(string[] args)
        {
            Random random = new Random();
            int minValue = 0;
            int maxValue = 100;

            int numberToCheck = random.Next(minValue, maxValue + 1);
            int power = 2;
            bool isFinished = false;

            int timesTomultiply = 0;
            int result = 0;

            for (int i = 2; !isFinished; i+=2)
            {
                numberToCheck /= power;

                if (numberToCheck >= 1)
                {
                    timesTomultiply++;
                }
                else
                {
                    isFinished = true;
                }
            }

            for (int i = 0; i < timesTomultiply; i++)
            {
                if(result == 0)
                {
                    result += power;
                }
                result *= power;
            }

            Console.WriteLine( result);
            Console.ReadLine();
        }
    }
}

