function formatujCzas(s){
	var h = Math.floor(s / 3600);
	s = s - h * 3600;
	var m = Math.floor(s / 60);
	s = s - m * 60;
	return (h) +":"+ (m<10?"0"+m:m) +":"+ (s<10?"0"+s:s);
}
